INSERT INTO `message_templates` (`id`, `user_id`, `branch_id`, `session_id`, `message_type_id`, `title`, `email_content`, `sms_content`, `template_id`, `whatsapp_content`, `email_status`, `sms_status`, `whatsapp_status`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(2, 1, 1, 3, 2, 'Admission Confirmation and Details', '<div><p>Dear {#name#}</p><p>Congratulations on your admission to {#school_name#}! Here are your admission details:</p><p><br /></p><p><span style=\"font-weight: bold;\">Username </span>: {#user_name#}</p><p><span style=\"font-weight: bold;\">Password </span>: {#password#}</p><p><span style=\"font-weight: bold;\">Email </span>: {#email#}</p><p><span style=\"font-weight: bold;\">Mobile </span>: {#mobile#}</p><p><br /></p><p>Please keep these details safe. Orientation details will follow shortly.</p><p>Welcome to {#school_name#}!</p><p>Best regards,</p><p>{#school_name#}<br /></p><br /></div>', 'Dear {#name#}\r\n\r\nCongratulations on your admission to {#school_name#}! Here are your admission details:\r\n\r\n\r\nUsername : {#user_name#}\r\n\r\nPassword : {#password#}\r\n\r\nEmail : {#email#}\r\n\r\nMobile : {#mobile#}\r\n\r\n\r\nPlease keep these details safe. Orientation details will follow shortly.\r\n\r\nWelcome to {#school_name#}!\r\n\r\nBest regards,\r\n\r\n{#school_name#}', NULL, 'Dear {#name#}\n\nCongratulations on your admission to {#school_name#}! Here are your admission details:\n\nAPK : https://greengarden.rusoft.in/schoolimage/default/GreenGarden.apk\n\nUsername : {#user_name#}\n\nPassword : {#password#}\n\nEmail : {#email#}\n\nMobile : {#mobile#}\n\n\nPlease keep these details safe. Orientation details will follow shortly.\n\nWelcome to {#school_name#}!\n\nBest regards,\n\n{#school_name#}', 1, 0, 1, 0, '2022-05-13 05:29:43.000000', '2023-09-21 11:15:06.000000', NULL),
(3, 1, 1, 3, 10, 'Software Expiring', '<p>Software Expiration Notification</p>\r\n\r\n<h2>Software Expiration Notification</h2>\r\n\r\n<p>Dear [{{ $data-&gt;name ?? &#39;&#39; }}],</p>\r\n\r\n<p>We would like to inform you that your software is going to expire soon. Please review the details below:</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Owner Name:</strong></td>\r\n			<td>[{{ $data-&gt;name ?? &#39;&#39; }}]</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Owner Email:</strong></td>\r\n			<td>[{{ $data-&gt;email ?? &#39;&#39; }}]</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Owner Mobile No:</strong></td>\r\n			<td>[{{ $data-&gt;mobile ?? &#39;&#39; }}]</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Expiry Date:</strong></td>\r\n			<td>[{{ $data-&gt;emc_date ?? &#39;&#39; }}]</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Registration Date:</strong></td>\r\n			<td>[{{ $data-&gt;registration_date ?? &#39;&#39; }}]</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Remaining Days:</strong></td>\r\n			<td>[{{ $remaining_days ?? &#39;&#39; }}]</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Please take the necessary actions to renew your software subscription before it expires.</p>\r\n\r\n<p>If you have any questions or need further assistance, please don&#39;t hesitate to contact our support team at [{{ $contact-&gt;email ?? &#39;&#39; }}].</p>\r\n\r\n<p>Thank you for choosing our software.</p>\r\n\r\n<p>Best regards,<br />\r\nRukmani Software<br />\r\n{{ $contact-&gt;email ?? &#39;&#39; }}<br />\r\n{{ $contact-&gt;phone ?? &#39;&#39; }}</p>', NULL, NULL, NULL, 1, 1, 1, 0, '2022-07-09 04:05:29.000000', '2023-07-28 14:26:09.000000', NULL),
(6, 1, 1, 3, 4, 'Student Fees Collection Confirmation', '<div><p>Dear&nbsp; {#name#},</p><p>We are writing to confirm the successful collection of your student fees for the current academic term at {#school_name#}. Here are the details:</p><p><br /></p><p><br /><span style=\"font-weight: bold;\">Collected Amount</span> : {#collect_amount#}<br /><br /><span style=\"font-weight: bold;\">Payment Method</span> : {#method#}<br /></p><p><br /></p><p>Your registration is now complete, and you have access to all School resources. If you have any questions, please do not hesitate to contact us at {#school_name#}.</p><p>Thank you for choosing {#school_name#}!</p><p>Best regards,</p><p>{#school_name#}<br /></p><br /></div>', 'Dear  {#name#},\r\n\r\nWe are writing to confirm the successful collection of your student fees for the current academic term at {#school_name#}. Here are the details:\r\n\r\n\r\n\r\nCollected Amount : {#collect_amount#}\r\n\r\nPayment Method : {#method#}\r\n\r\n\r\nYour registration is now complete, and you have access to all School resources. If you have any questions, please do not hesitate to contact us at {#school_name#}.\r\n\r\nThank you for choosing {#school_name#}!\r\n\r\nBest regards,\r\n\r\n{#school_name#}', NULL, 'Dear  Parent,\r\n\r\nWe are pleased to inform you that we have successfully received the fee payment for {#name#}.\r\n\r\nDetails of the Payment : \r\nAmount Paid : {#collect_amount#}\r\n\r\nThank you for your timely payment. If you have any questions or need further assistance, please feel free to contact the school office.\r\n\r\nBest regards,\r\n\r\n{#school_name#}\r\n{#school_mobile#}', 1, 1, 1, 0, '2023-02-07 17:10:46.000000', '2024-09-06 18:21:13.000000', NULL),
(7, 1, 1, 3, 9, 'Book Return', '<div><p>Dear {#admin_name#},</p><p>I\'ve returned the book \"{#book_name#}\" borrowed on {#submit_date#}. The book\'s price is {#invoice#}.</p><p>Thanks, <br /></p><p>{#school_name#}<br /></p><br /></div>', 'Dear {#admin_name#},\r\n\r\nI\'ve returned the book \"{#book_name#}\" borrowed on {#submit_date#}. The book\'s price is {#invoice#}.\r\n\r\nThanks,\r\n\r\n{#school_name#}', NULL, 'Dear {#admin_name#},\r\n\r\nI\'ve returned the book \"{#book_name#}\" borrowed on {#submit_date#}. The book\'s price is {#invoice#}.\r\n\r\nThanks,\r\n\r\n{#school_name#}', 1, 1, 1, 0, '2023-07-05 17:55:52.000000', '2023-09-21 14:22:51.000000', NULL),
(8, 1, 1, 3, 35, 'Assignment', '<div><p>Dear {#name#},</p><p>I hope this message finds you well. I have assigned the following homework to you:</p><p><br /></p><span style=\"font-weight: bold;\">Subject </span>: {#subject#}<br /></div>\r\n<div><p><span style=\"font-weight: bold;\">Title </span>: {#title#}</p><p><span><span class=\"JgzqYd RES9jf\"><span style=\"font-weight: bold;\">Description </span>: {#description#}</span></span></p><p><span><span class=\"JgzqYd RES9jf\"><span><span class=\"JgzqYd RES9jf\"><span style=\"font-weight: bold;\">Submission Date</span> : {#<span><span class=\"JgzqYd RES9jf\">submission</span></span>_date#}</span></span><br /></span></span></p></div>\r\n<p><br /></p>\r\n<div><p>Please ensure you complete and submit it on time. If you have any questions or need clarification, don\'t hesitate to reach out to me.</p><p>Best regards,</p><p>{#school_name#}<br /></p><p></p><br /></div>', 'Dear {#name#},\r\n\r\nI hope this message finds you well. I have assigned the following homework to you:\r\n\r\n\r\nSubject : {#subject#}\r\n\r\nTitle : {#title#}\r\n\r\nDescription : {#description#}\r\n\r\nSubmission Date : {#submission_date#}\r\n\r\nPlease ensure you complete and submit it on time. If you have any questions or need clarification, don\'t hesitate to reach out to me.\r\n\r\nBest regards,\r\n\r\n{#school_name#}', '12133', 'Dear {#name#},\r\n\r\nI hope this message finds you well. I have assigned the following homework to you:\r\n\r\n\r\nSubject : {#subject#}\r\n\r\nTitle : {#title#}\r\n\r\nDescription : {#description#}\r\n\r\nSubmission Date : {#submission_date#}\r\n\r\nPlease ensure you complete and submit it on time. If you have any questions or need clarification, don\'t hesitate to reach out to me.\r\n\r\nBest regards,\r\n\r\n{#school_name#}', 1, 1, 1, 0, '2023-07-25 18:25:21.000000', '2023-09-21 09:32:20.000000', NULL),
(14, 1, 1, 3, 1, 'Student Registration Confirmation and Details', '<div><p>Dear {#name#},</p><p>Your registration at {#school_name#}&nbsp; is now complete. Below are your registration details:</p><p></p></div>\r\n<div><p><br /></p><p><span style=\"font-weight: bold;\">Email </span>: {#email#}</p><p><span style=\"font-weight: bold;\">Mobile </span>: {#mobile#}</p><p><br /></p></div>\r\n<div><p>Please secure these details. Further instructions will be provided soon.</p><p>Welcome to {#school_name#}!</p><p>Best regards, <br /></p><p>{#school_name#}<br /></p></div>', 'Dear {#name#},\r\n\r\nYour registration at {#school_name#}  is now complete. Below are your registration details:\r\n\r\n\r\nEmail : {#email#}\r\n\r\nMobile : {#mobile#}\r\n\r\n\r\nPlease secure these details. Further instructions will be provided soon.\r\n\r\nWelcome to {#school_name#}!\r\n\r\nBest regards,\r\n\r\n{#school_name#}', '1207169157621548385', 'Dear {#name#},\r\n\r\nYour registration at {#school_name#}  is now complete. Below are your registration details:\r\n\r\n\r\nEmail : {#email#}\r\n\r\nMobile : {#mobile#}\r\n\r\n\r\nPlease secure these details. Further instructions will be provided soon.\r\n\r\nWelcome to {#school_name#}!\r\n\r\nBest regards,\r\n\r\n{#school_name#}', 1, 1, 1, 0, '2023-07-28 16:45:25.000000', '2023-09-20 10:07:48.000000', NULL),
(15, 1, 1, 3, 3, 'Student Attendance', '<div><div>Dear {#name#},&nbsp;</div>\r\n<div><p>I am writing to inform you that your attendance for today, {#today_day#}, is marked as \"{#attendance_status#}.\"</p><p>If you have any questions or need additional information, please do not hesitate to reach out. <br /></p><p><br /></p><p>Best regards,&nbsp;</p><p>{#school_name#}</p><p>{#support_no#}</p></div></div>', 'Dear {#name#}, \r\n\r\nI am writing to inform you that your attendance for today, {#today_day#}, is marked as \"{#attendance_status#}.\"\r\n\r\nIf you have any questions or need additional information, please do not hesitate to reach out.\r\n\r\n\r\nBest regards, \r\n\r\n{#school_name#}\r\n\r\n{#support_no#}', NULL, 'Dear {#name#}, \r\n\r\nI am writing to inform you that your attendance for today, {#today_day#}, is marked as \"{#attendance_status#}.\"\r\n\r\nIf you have any questions or need additional information, please do not hesitate to reach out.\r\n\r\n\r\nBest regards, \r\n\r\n{#school_name#}\r\n\r\n{#support_no#}', 1, 1, 1, 0, '2023-08-05 12:38:15.000000', '2023-09-20 10:19:37.000000', NULL),
(16, 1, 1, 3, 12, 'Student Certificate', '<p>\r\nCongratulations your Certificate send successfully in {#school_name#}!</p>\r\n<p>&nbsp;Dear {#name#}&nbsp;</p>\r\n<p>&nbsp;Father name {#father_name#}&nbsp;</p>\r\n<p>From Year {#frome_year#}&nbsp;</p>\r\n<p>To Year {#to_year#}</p>\r\n<p>&nbsp;Best regards,\r\n\r\n{#school_name#}</p>\r\n<p>&nbsp;School Certificate<br /></p>', 'Congratulations your Certificate send successfully in {#school_name#}!\r\n\r\n Dear {#name#} \r\n\r\n Father name {#father_name#} \r\n\r\nFrom Year {#frome_year#} \r\n\r\nTo Year {#to_year#}\r\n\r\n Best regards, {#school_name#}\r\n\r\n School Certificate', NULL, 'Congratulations your Certificate send successfully in {#school_name#}!\r\n\r\n Dear {#name#} \r\n\r\n Father name {#father_name#} \r\n\r\nFrom Year {#frome_year#} \r\n\r\nTo Year {#to_year#}\r\n\r\n Best regards, {#school_name#}\r\n\r\n School Certificate', 1, 1, 1, 0, '2023-08-26 18:36:33.000000', '2023-08-28 10:58:54.000000', '2023-08-28 10:58:54.000000'),
(17, 1, 1, 3, 12, 'Student Certificate', '<div><div class=\"flex flex-grow flex-col gap-3 max-w-full\"><div class=\"min-h-[20px] flex flex-col items-start gap-3 overflow-x-auto whitespace-pre-wrap break-words\"><div class=\"markdown prose w-full break-words dark:prose-invert light\"><p>Dear {#name#},</p><p>I am pleased to confirm that {#name#} has demonstrated exceptional character and integrity during their time with us. They are a person of high moral standing, earning our utmost trust.</p><p>Best regards,</p><p></p><p></p><p>{#school_name#}</p><br /></div></div></div><br /></div>', 'Dear {#name#},\r\n\r\nI am pleased to confirm that {#name#} has demonstrated exceptional character and integrity during their time with us. They are a person of high moral standing, earning our utmost trust.\r\n\r\nBest regards,\r\n\r\n{#school_name#}', '1207169157621548385', 'Dear {#name#},\r\n\r\nI am pleased to confirm that {#name#} has demonstrated exceptional character and integrity during their time with us. They are a person of high moral standing, earning our utmost trust.\r\n\r\nBest regards,\r\n\r\n{#school_name#}', 1, 1, 1, 0, '2023-08-28 10:59:05.000000', '2023-09-19 10:30:04.000000', NULL),
(18, 1, 1, 3, 13, 'Event Certificate', '<div><div class=\"flex flex-grow flex-col gap-3 max-w-full\"><div class=\"min-h-[20px] flex flex-col items-start gap-3 overflow-x-auto whitespace-pre-wrap break-words\"><div class=\"markdown prose w-full break-words dark:prose-invert light\"><p>Dear {#name#},</p><p>Congratulations! We are pleased to present you with this Event Certificate in recognition of your participation and outstanding contribution to {#event_type#} held on {#organized_date#}. Your dedication and enthusiasm made the event a great success.</p><p>Best regards,</p><p>{#school_name#}<br /></p></div></div></div><br /></div>', 'Dear {#name#},\r\n\r\nCongratulations! We are pleased to present you with this Event Certificate in recognition of your participation and outstanding contribution to {#event_type#} held on {#organized_date#}. Your dedication and enthusiasm made the event a great success.\r\n\r\nBest regards,\r\n\r\n{#school_name#}', '1207169157621548385', 'Dear {#name#},\r\n\r\nCongratulations! We are pleased to present you with this Event Certificate in recognition of your participation and outstanding contribution to {#event_type#} held on {#organized_date#}. Your dedication and enthusiasm made the event a great success.\r\n\r\nBest regards,\r\n\r\n{#school_name#}', 1, 1, 1, 0, '2023-08-28 13:43:16.000000', '2023-09-19 10:46:27.000000', NULL),
(19, 1, 1, 3, 14, 'Transfer Certificate Issued', '<div><p>Dear {#name#},</p><p>I hope this message finds you well. We are writing to inform you that your Transfer Certificate (TC) has been successfully processed and is now available for collection at {#school_name#}.</p><p>You may visit our administrative office during our regular office hours to receive your TC. Please make sure to bring a valid ID for identification.</p><p>If you have any questions or require any further assistance, feel free to reach out to us at{#contact_no#}.</p><p>We wish you all the best in your future endeavors.</p><p>Warm regards,</p><p>{#school_name#}</p><p>{#contact_no#}</p><br /></div>', 'Dear {#name#},\r\n\r\nI hope this message finds you well. We are writing to inform you that your Transfer Certificate (TC) has been successfully processed and is now available for collection at {#school_name#}.\r\n\r\nYou may visit our administrative office during our regular office hours to receive your TC. Please make sure to bring a valid ID for identification.\r\n\r\nIf you have any questions or require any further assistance, feel free to reach out to us at {#contact_no#}.\r\n\r\nWe wish you all the best in your future endeavors.\r\n\r\nWarm regards,\r\n\r\n{#school_name#}\r\n\r\n{#contact_no#}', '1207169157621548385', 'Dear {#name#},\r\n\r\nI hope this message finds you well. We are writing to inform you that your Transfer Certificate (TC) has been successfully processed and is now available for collection at {#school_name#}.\r\n\r\nYou may visit our administrative office during our regular office hours to receive your TC. Please make sure to bring a valid ID for identification.\r\n\r\nIf you have any questions or require any further assistance, feel free to reach out to us at {#contact_no#}.\r\n\r\nWe wish you all the best in your future endeavors.\r\n\r\nWarm regards,\r\n\r\n{#school_name#}\r\n\r\n{#contact_no#}', 1, 1, 1, 0, '2023-08-28 15:38:42.000000', '2023-09-19 11:36:09.000000', NULL),
(20, 1, 1, 3, 15, 'User Account Created Successfully', '<div><p>Dear&nbsp; {#name#},</p><p>We are delighted to confirm that your user account has been successfully created with the following details:</p><span style=\"font-weight: bold;\">User Name</span>&nbsp; :{#user_name#}</div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n<div><p><span style=\"font-weight: bold;\">Password</span>&nbsp; :{#password#}</p><p><span style=\"font-weight: bold;\">Role&nbsp; </span>: {#role#} <br /></p><p><span style=\"font-weight: bold;\">Address&nbsp; </span>:{#address#}</p><p><span style=\"font-weight: bold;\">Mobile Number&nbsp; </span>:{#mobile_no#}</p></div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n<div><p>You can now log in using your provided username and password to access our platform and enjoy our services. </p><p>If you have any questions or need assistance, please do not hesitate to reach out to our support team at {#support_email#}.</p><p>Thank you for choosing {#school_name#}. We appreciate your business and look forward to serving you.</p><p>Best regards,</p><p>\r\n{#school_name#} <br /></p><p>{#support_no#}</p><br /></div>', 'Dear  {#name#},\r\n\r\nWe are delighted to confirm that your user account has been successfully created with the following details:\r\nUser Name  :{#user_name#}\r\n\r\nPassword  :{#password#}\r\n\r\nRole  : {#role#}\r\n\r\nAddress  :{#address#}\r\n\r\nMobile Number  :{#mobile_no#}\r\n\r\nYou can now log in using your provided username and password to access our platform and enjoy our services.\r\n\r\nIf you have any questions or need assistance, please do not hesitate to reach out to our support team at {#support_email#}.\r\n\r\nThank you for choosing {#school_name#}. We appreciate your business and look forward to serving you.\r\n\r\nBest regards,\r\n\r\n{#school_name#}\r\n\r\n{#support_no#}', '1207169157621548385', 'Dear  {#name#},\r\n\r\nWe are delighted to confirm that your user account has been successfully created with the following details:\r\nUser Name  :{#user_name#}\r\n\