(22, 1, 1, 3, 17, 'Urgent Administrative Complaint', '<div><p>Dear {#admin_name#} sir,</p><p>I am writing to report a pressing administrative issue that needs immediate attention.</p><p><br /></p><p><span style=\"font-weight: bold;\">Name : </span>{#name#}<span style=\"font-weight: bold;\"><br /></span></p><p><span style=\"font-weight: bold;\">Class : </span>{#class_name#}<span style=\"font-weight: bold;\"><br /></span></p><p><span style=\"font-weight: bold;\">Subject </span>: {#subject#}</p><p><span style=\"font-weight: bold;\">Description </span>: {#description#}</p><p><br /></p><p>I kindly request a prompt investigation and resolution of this matter to ensure a smooth academic experience for all students.</p><p>Thank you for your swift action.</p><p>Sincerely,</p><p>{#name#}</p><br /></div>', 'Dear {#admin_name#} sir,\r\n\r\nI am writing to report a pressing administrative issue that needs immediate attention.\r\n\r\n\r\nName : {#name#}\r\n\r\nClass : {#class_name#}\r\n\r\nSubject : {#subject#}\r\n\r\nDescription : {#description#}\r\n\r\n\r\nI kindly request a prompt investigation and resolution of this matter to ensure a smooth academic experience for all students.\r\n\r\nThank you for your swift action.\r\n\r\nSincerely,\r\n\r\n{#name#}', '1207169157621548385', 'Dear {#admin_name#} sir,\r\n\r\nI am writing to report a pressing administrative issue that needs immediate attention.\r\n\r\n\r\nName : {#name#}\r\n\r\nClass : {#class_name#}\r\n\r\nSubject : {#subject#}\r\n\r\nDescription : {#description#}\r\n\r\n\r\nI kindly request a prompt investigation and resolution of this matter to ensure a smooth academic experience for all students.\r\n\r\nThank you for your swift action.\r\n\r\nSincerely,\r\n\r\n{#name#}', 1, 1, 1, 0, '2023-08-28 18:06:56.000000', '2023-09-19 16:42:38.000000', NULL),
