: 16px; white-space: pre-wrap; background-color: rgb(247, 247, 248)\">Best regards,</p>', 'Subject: Account Details {#school_name#}\r\n\r\nDear {#name#},\r\n\r\nI hope this message finds you well. As requested, here are your account details:\r\n\r\n\r\nBranch Name :- {#branch_name#}\r\n\r\nBank Name :- {#bank_name#}\r\n\r\nAccount Number :- {#account_number#}\r\n\r\n Ifsc Code  :- {#ifsc_code#}\r\n\r\n\r\nThank you for choosing {#school_name#} for your account needs. We appreciate your business.\r\n\r\nBest regards,', '1207169157621548385', 'Subject: Account Details {#school_name#}\r\n\r\nDear {#name#},\r\n\r\nI hope this message finds you well. As requested, here are your account details:\r\n\r\n\r\nBranch Name :- {#branch_name#}\r\n\r\nBank Name :- {#bank_name#}\r\n\r\nAccount Number :- {#account_number#}\r\n\r\n Ifsc Code  :- {#ifsc_code#}\r\n\r\n\r\nThank you for choosing {#school_name#} for your account needs. We appreciate your business.\r\n\r\nBest regards,', 1, 1, 1, 0, '2023-09-01 12:50:19.000000', '2023-09-19 10:12:38.000000', NULL),
(29, 13, 1, 3, 25, 'Hostel Fee Payment Confirmation', '<div><p>Dear {#name#},<br /></p><p>Good news! Your hostel fees&nbsp; have been successfully collected.</p><p>Details:</p><p><span style=\"font-weight: bold;\">Amount </span>:{#total_amount#}</p><p><span style=\"font-weight: bold\">Due Amount</span>:{#due_amount#}<br /><br /><span style=\"font-weight: bold\">Pay Amount</span>:{#pay_amount#}<br /></p><p><span style=\"font-weight: bold\">Renew Date</span>:{#renew_date#}<br /></p><p><span style=\"font-weight: bold\">Method </span>:{#method#}<br /></p><p>Your prompt payment is greatly appreciated and contributes to the smooth operation of our hostel. For any questions or assistance, contact us at {#support_no#}.</p><p>Thank you for your cooperation.</p><p>Best regards,</p><p>{#school_name#}<br /></p><br /></div>', 'Dear {#name#},\r\n\r\nGood news! Your hostel fees for the {#this_month#}  have been successfully collected.\r\n\r\nDetails:\r\n\r\nAmount :{#amount#}\r\n\r\nMethod :{#method#}\r\n\r\nYour prompt payment is greatly appreciated and contributes to the smooth operation of our hostel. For any questions or assistance, contact us at {#support_no#}.\r\n\r\nThank you for your cooperation.\r\n\r\nBest regards,\r\n\r\n{#school_name#}', '1207169157621548385', 'Dear {#name#},\r\n\r\nGood news! Your hostel fees  have been successfully collected.\r\n\r\nDetails:\r\n\r\nAmount :{#total_amount#}\r\n\r\nDue Amount:{#due_amount#}\r\n\r\nPay Amount:{#pay_amount#}\r\n\r\nRenew Date:{#renew_date#}\r\n\r\nMethod :{#method#}\r\n\r\nYour prompt payment is greatly appreciated and contributes to the smooth operation of our hostel. For any questions or assistance, contact us at {#support_no#}.\r\n\r\nThank you for your cooperation.\r\n\r\nBest regards,\r\n\r\n{#school_name#}', 1, 1, 1, 0, '2023-09-01 15:40:33.000000', '2024-03-11 16:47:49.000000', NULL),
(30, 1, 1, 3, 26, 'Hostel Room Assignment Confirmation', '<div><p>Dear {#name#},</p><p>Your hostel room assignment is confirmed:<br /></p><p><span style=\"font-weight: bold;\">Hostel</span> : {#hostel_name#}<br /><br /><span style=\"font-weight: bold;\">Building </span>: {#building#}</p><p><span style=\"font-weight: bold\">Floor No. :</span> {#floor_no#}<br /></p><p><span style=\"font-weight: bold;\">Room No. :</span> {#room_no#}</p><p><span style=\"font-weight: bold\">Bed No. :</span> {#bed_no#}<br /></p><p><span style=\"font-weight: bold;\">Date </span>: {#assigned_date#}<br /><br /></p><p>For any queries or assistance, please contact us at {#support_no#}.</p><p>Welcome to {#hostel_name#}!</p><p>Best regards,</p><p>{#hostel_name#}</p><br /></div>', 'Dear {#name#},\r\n\r\nYour hostel room assignment is confirmed:\r\n\r\nHostel : {#hostel_name#}\r\n\r\nBuilding : {#building#}\r\n\r\nFloor No. : {#floor_no#}\r\n\r\nRoom No. : {#room_no#}\r\n\r\nBed No. : {#bed_no#}\r\n\r\nDate : {#assigned_date#}\r\n\r\nFor any queries or assistance, please contact us at {#support_no#}.\r\n\r\nWelcome to {#hostel_name#}!\r\n\r\nBest regards,\r\n\r\n{#hostel_name#}', '1207169157621548385', 'Dear {#name#},\r\n\r\nYour hostel room assignment is confirmed:\r\n\r\nHostel : {#hostel_name#}\r\n\r\nBuilding : {#building#}\r\n\r\nFloor No. : {#floor_no#}\r\n\r\nRoom No. : {#room_no#}\r\n\r\nBed No. : {#bed_no#}\r\n\r\nDate : {#assigned_date#}\r\n\r\nFor any queries or assistance, please contact us at {#support_no#}.\r\n\r\nWelcome to {#hostel_name#}!\r\n\r\nBest regards,\r\n\r\n{#hostel_name#}', 1, 1, 1, 0, '2023-09-01 17:38:02.000000', '2023-09-20 17:56:26.000000', NULL),
(31, 1, 1, 3, 27, 'Library Assigned', '<div><p>Dear {#name#},</p><p>Your library Assigned Successfully.<br /><br /></p><p><span style=\"font-weight: bold;\">Library name</span> : {#library_name#}</p><p><span style=\"font-weight: bold;\">Cabin name</span> : {#cabin_name#}</p><p><span style=\"font-weight: bold;\">Library Fees</span> : {#library_fees#}<br /></p><p><br /></p><p><br /></p><p>Happy reading!</p><p>{#school_name#}</p><br /></div>', 'Dear {#name#},\r\n\r\nYour library Assigned Successfully.\r\n\r\nLibrary name : {#library_name#}\r\n\r\nCabin name : {#cabin_name#}\r\n\r\nLibrary Fees : {#library_fees#}\r\n\r\n\r\nHappy reading!\r\n\r\n{#school_name#}', '1207169157621548385', 'Dear {#name#},\r\n\r\nYour library Assigned Successfully.\r\n\r\nLibrary name : {#library_name#}\r\n\r\nCabin name : {#cabin_name#}\r\n\r\nLibrary Fees : {#library_fees#}\r\n\r\n\r\nHappy reading!\r\n\r\n{#school_name#}', 1, 1, 1, 0, '2023-09-01 18:09:10.000000', '2024-03-12 14:19:34.000000', NULL),
(32, 1, 1, 3, 28, 'bookassign', '<p><br /></p>\r\n<p>Congratulations your&nbsp; Library&nbsp; Assign&nbsp;successfully in {#school_name#}!</p>\r\n<p>Dear;- {#first_name#}&nbsp; {#last_name#}&nbsp;</p>\r\n<p><span>Mobile :- {#mobile#}<br /></span></p>\r\n<p><span>Email :- {#email#}</span></p>\r\n<p>Father Name :- {#father_name#}</p>\r\n<p>Address :- {#address#}<br /></p>\r\n<p></p>\r\n<p>&nbsp;Best regards, {#school_name#}</p>', 'Congratulations your  Library  Assign successfully in {#school_name#}!\r\n\r\nDear;- {#first_name#}  {#last_name#} \r\n\r\nMobile :- {#mobile#}\r\n\r\nEmail :- {#email#}\r\n\r\nFather Name :- {#father_name#}\r\n\r\nAddress :- {#address#}\r\n\r\n Best regards, {#school_name#}', '1207169157621548385', 'Congratulations your  Library  Assign successfully in {#school_name#}!\r\n\r\nDear;- {#first_name#}  {#last_name#} \r\n\r\nMobile :- {#mobile#}\r\n\r\nEmail :- {#email#}\r\n\r\nFather Name :- {#father_name#}\r\n\r\nAddress :- {#address#}\r\n\r\n Best regards, {#school_name#}', 1, 1, 1, 0, '2023-09-01 18:35:45.000000', '2023-09-01 18:42:43.000000', NULL),
(33, 1, 1, 3, 29, 'Inventory Item', '<div><p>Dear {#admin_name#},</p><p>We are pleased to inform you that a new inventory item has been added to our system. Below are the details:</p><p>Item Name : {#item_name#}<br /></p><p>Quantity : {#quantity#}<br /></p><p>Price :{#amount#}</p><p>This addition to our inventory will help us better serve our customers and maintain efficient operations. </p><p>Thank you for your attention, and we look forward to your continued support.</p><p>Best regards,</p><p>{#school_name#}</p><p>{#support_no#}</p><br /></div>', 'Dear {#admin_name#},\r\n\r\nWe are pleased to inform you that a new inventory item has been added to our system. Below are the details:\r\n\r\nItem Name : {#item_name#}\r\n\r\nQuantity : {#quantity#}\r\n\r\nPrice :{#amount#}\r\n\r\nThis addition to our inventory will help us better serve our customers and maintain efficient operations.\r\n\r\nThank you for your attention, and we look forward to your continued support.\r\n\r\nBest regards,\r\n\r\n{#school_name#}\r\n\r\n{#support_no#}', '1207169157621548385', 'Dear {#admin_name#},\r\n\r\nWe are pleased to inform you that a new inventory item has been added to our system. Below are the details:\r\n\r\nItem Name : {#item_name#}\r\n\r\nQuantity : {#quantity#}\r\n\r\nPrice :{#amount#}\r\n\r\nThis addition to our inventory will help us better serve our customers and maintain efficient operations.\r\n\r\nThank you for your attention, and we look forward to your continued support.\r\n\r\nBest regards,\r\n\r\n{#school_name#}\r\n\r\n{#support_no#}', 1, 1, 1, 0, '2023-09-02 18:38:42.000000', '2023-09-19 15:43:28.000000', NULL),
(34, 1, 1, 3, 30, 'Bus Assignment', '<div><p>Dear {#name#},</p><p>You have been assigned to Bus {#bus_no#} for the upcoming academic year. Your bus driver\'s name is {#driver_name#}, and you can reach them at {#driver_no#}.</p><p>Please refer to the attached schedule for pick-up and drop-off details.</p><p>If you have any questions, feel free to reach out.</p><p>Best regards,</p><p>{#school_name#}</p><br /></div>', 'Dear {#name#},\r\n\r\nYou have been assigned to Bus {#bus_no#} for the upcoming academic year. Your bus driver\'s name is {#driver_name#}, and you can reach them at {#driver_no#}.\r\n\r\nPlease refer to the attached schedule for pick-up and drop-off details.\r\n\r\nIf you have any questions, feel free to reach out.\r\n\r\nBest regards,\r\n\r\n{#school_name#}', '1207169157621548385', 'Dear {#name#},\r\n\r\nYou have been assigned to Bus {#bus_no#} for the upcoming academic year. Your bus driver\'s name is {#driver_name#}, and you can reach them at {#driver_no#}.\r\n\r\nPlease refer to the attached schedule for pick-up and drop-off details.\r\n\r\nIf you have any questions, feel free to reach out.\r\n\r\nBest regards,\r\n{#school_name#}', 0, 1, 1, 0, '2023-09-04 09:39:55.000000', '2023-09-19 13:36:45.000000', NULL);
