(35, 1, 1, 3, 31, 'Important Notice', '<div><p>Dear {#name#},</p><p>I hope this message finds you well. We would like to bring to your \r\nattention an important notice regarding {#title#}, which \r\nwill be in effect from {#from_date#} to {#to_date#}. Please take a moment \r\nto review the details below:</p><p><br /></p><p>{#notice_content#}</p><p><br /></p><p>Your prompt attention to this matter is greatly appreciated. If you have any questions or require further clarification, please don\'t hesitate to contact us at {#support_no#}.</p><p>Thank you for your cooperation and understanding.</p><p>Sincerely,</p><p>{#creator_name#}</p><p>{#role#}<br /></p><p>{#mobile_no#}<br /></p><br /></div>', 'Dear {#name#},\r\n\r\nI hope this message finds you well. We would like to bring to your attention an important notice regarding {#title#}, which will be in effect from {#from_date#} to {#to_date#}. Please take a moment to review the details below:\r\n\r\n\r\n{#notice_content#}\r\n\r\n\r\nYour prompt attention to this matter is greatly appreciated. If you have any questions or require further clarification, please don\'t hesitate to contact us at {#support_no#}.\r\n\r\nThank you for your cooperation and understanding.\r\n\r\nSincerely,\r\n\r\n{#creator_name#}\r\n\r\n{#role#}\r\n\r\n{#mobile_no#}', '1207169157621548385', 'Dear {#name#},\r\n\r\nI hope this message finds you well. We would like to bring to your attention an important notice regarding {#title#}, which will be in effect from {#from_date#} to {#to_date#}. Please take a moment to review the details below:\r\n\r\n\r\n{#notice_content#}\r\n\r\n\r\nYour prompt attention to this matter is greatly appreciated. If you have any questions or require further clarification, please don\'t hesitate to contact us at {#support_no#}.\r\n\r\nThank you for your cooperation and understanding.\r\n\r\nSincerely,\r\n\r\n{#creator_name#}\r\n\r\n{#role#}\r\n\r\n{#mobile_no#}', 1, 1, 1, 0, '2023-09-04 09:50:35.000000', '2023-09-20 11:25:49.000000', NULL),
(36, 1, 1, 3, 32, 'Sports Certificate', '<div><p>Dear {#name#},</p><p>We are proud to award you this Sports Certificate on {#event_date#} in recognition of your exceptional performance and sportsmanship in {#sports_name#}. Your dedication and hard work have set an inspiring example for all.</p><p>Congratulations!</p><p>Best regards,</p><p>{#school_name#}</p></div>', 'Dear {#name#},\r\n\r\nWe are proud to award you this Sports Certificate on {#event_date#} in recognition of your exceptional performance and sportsmanship in {#sports_name#}. Your dedication and hard work have set an inspiring example for all.\r\n\r\nCongratulations!\r\n\r\nBest regards,\r\n\r\n{#school_name#}', '1207169157621548385', 'Dear {#name#},\r\n\r\nWe are proud to award you this Sports Certificate on {#event_date#} in recognition of your exceptional performance and sportsmanship in {#sports_name#}. Your dedication and hard work have set an inspiring example for all.\r\n\r\nCongratulations!\r\n\r\nBest regards,\r\n{#school_name#}', 1, 1, 1, 0, '2023-09-13 12:25:03.000000', '2023-09-19 11:18:18.000000', NULL),
(37, 1, 1, 3, 33, 'Salary Generated Notification', '<div><p>Dear {#employee_name#},</p><p>We are pleased to inform you that your salary for the month of {#this_month#} has been successfully generated. Here are the details:</p><p><strong>Employee Name : </strong>{#employee_name#}</p><p><strong>Month :</strong> {#this_month#}</p><p><strong>Year :</strong> {#this_year#}</p><p><strong>Total Earnings :</strong> {#this_month_salery#}</p><p><strong>Net Salary :</strong> {#net_selery#}</p><p>Your salary will be credited to your designated bank account on regular payment date. Please ensure that all necessary banking information is up to date to facilitate a smooth transfer.</p><p>If you have any questions or concerns regarding your salary statement, please feel free to contact our HR department at {#support_no#}.</p><p>We appreciate your hard work and dedication to our organization.</p><p>Best regards,</p><p>{#school_name#} <br /></p><p>{#support_no#}<br /></p><br /></div>', 'Dear {#employee_name#},\r\n\r\nWe are pleased to inform you that your salary for the month of {#this_month#} has been successfully generated. Here are the details:\r\n\r\nEmployee Name : {#employee_name#}\r\n\r\nMonth : {#this_month#}\r\n\r\nYear : {#this_year#}\r\n\r\nTotal Earnings : {#this_month_salery#}\r\n\r\nNet Salary : {#net_selery#}\r\n\r\nYour salary will be credited to your designated bank account on regular payment date. Please ensure that all necessary banking information is up to date to facilitate a smooth transfer.\r\n\r\nIf you have any questions or concerns regarding your salary statement, please feel free to contact our HR department at {#support_no#}.\r\n\r\nWe appreciate your hard work and dedication to our organization.\r\n\r\nBest regards,\r\n\r\n{#school_name#}\r\n\r\n{#support_no#}', '1207169157621548385', 'Dear {#employee_name#},\r\n\r\nWe are pleased to inform you that your salary for the month of {#this_month#} has been successfully generated. Here are the details:\r\n\r\nEmployee Name : {#employee_name#}\r\n\r\nMonth : {#this_month#}\r\n\r\nYear : {#this_year#}\r\n\r\nTotal Earnings : {#this_month_salery#}\r\n\r\nNet Salary : {#net_selery#}\r\n\r\nYour salary will be credited to your designated bank account on regular payment date. Please ensure that all necessary banking information is up to date to facilitate a smooth transfer.\r\n\r\nIf you have any questions or concerns regarding your salary statement, please feel free to contact our HR department at {#support_no#}.\r\n\r\nWe appreciate your hard work and dedication to our organization.\r\n\r\nBest regards,\r\n\r\n{#school_name#}\r\n\r\n{#support_no#}', 1, 0, 1, 0, '2023-09-13 14:16:03.000000', '2023-09-19 12:52:29.000000', NULL),
(38, 1, 1, 3, 34, 'Today\'s Attendance', '<div>Dear {#teacher_name#},&nbsp;</div>\r\n<div><p>I am writing to inform you that your attendance for today, {#today_day#}, is marked as \"{#attendance_status#}.\"</p><p>If you have any questions or need additional information, please do not hesitate to reach out. <br /></p><p><br /></p><p>Best regards,&nbsp;</p><p>{#school_name#}</p><p>{#school_query_no#}</p></div>', 'Dear {#teacher_name#},\r\n\r\nI am writing to inform you that your attendance for today, {#today_day#}, is marked as \"{#attendance_status#}.\"\r\n\r\nIf you have any questions or need additional information, please do not hesitate to reach out.\r\n\r\nBest regards,\r\n\r\n{#school_name#}\r\n{#school_query_no#}', '4565464456', 'Dear {#teacher_name#},\r\n\r\nI am writing to inform you that your attendance for today, {#today_day#}, is marked as \"{#attendance_status#}.\"\r\n\r\nIf you have any questions or need additional information, please do not hesitate to reach out.\r\n\r\nBest regards,\r\n\r\n{#school_name#}\r\n{#school_query_no#}', 1, 1, 1, 0, NULL, '2023-09-16 14:28:04.000000', NULL),
(39, 1, 1, 3, 36, 'Your Exam', '<div><p>Dear {#name#},</p><p>Here are the details for your upcoming exam:</p><p><br /></p><p><span style=\"font-weight: bold;\">Exam Name</span> : {#exam_name#}</p><p><span style=\"font-weight: bold;\">Exam Date</span> : {#exam_date#}</p><p><br /></p><p>If you have any questions or inquiries, please feel free to contact us at {#support_no#}.</p><p>Best regards,</p><p>{#school_name#}<br /></p><br /></div>', 'Dear {#name#},\r\n\r\nHere are the details for your upcoming exam:\r\n\r\nExam Name : {#exam_name#}\r\n\r\nExam Date : {#exam_date#}\r\n\r\nIf you have any questions or inquiries, please feel free to contact us at {#support_no#}.\r\n\r\nBest regards,\r\n\r\n{#school_name#}', '4565464456', 'Dear {#name#},\r\n\r\nHere are the details for your upcoming exam:\r\n\r\nExam Name : {#exam_name#}\r\n\r\nExam Date : {#exam_date#}\r\n\r\nIf you have any questions or inquiries, please feel free to contact us at {#support_no#}.\r\n\r\nBest regards,\r\n\r\n{#school_name#}', 1, 1, 1, 0, NULL, '2023-09-21 16:06:30.000000', NULL),
(40, 1, 1, 3, 37, 'Important Message', '<div><p>Dear {#name#},</p><p><br /></p></div>\r\n<div><p>{#message#}</p><p><br /></p><p>If you have any questions or inquiries, please feel free to contact us at {#support_no#}.</p><p>Best regards,</p><p>{#school_name#}<br /></p><br /></div>', 'Dear {#name#},\r\n\r\n\r\n{#message#}\r\n\r\n\r\nIf you have any questions or inquiries, please feel free to contact us at {#support_no#}.\r\n\r\nBest regards,\r\n\r\n{#school_name#}', '4565464456', 'Dear {#name#},\r\n\r\n\r\n{#message#}\r\n\r\n\r\nIf you have any questions or inquiries, please feel free to contact us at {#support_no#}.\r\n\r\nBest regards,\r\n\r\n{#school_name#}', 1, 1, 1, 0, NULL, '2023-09-21 18:16:17.000000', NULL),
(41, 1, 1, 3, 38, 'One Time Password', '<p>Dear {#name#},</p>\r\n\r\n\r\n<p>Your One-Time Password (OTP) is: {#otp#}<br /></p>\r\n\r\n\r\n<p>If you have concerns, contact us immediately.</p>\r\n\r\n\r\n<p>Best, {#school_name#}</p>', 'Dear {#name#},\r\n\r\nYour One-Time Password (OTP) is: {#otp#}\r\n\r\nIf you have concerns, contact us immediately.\r\n\r\nBest, {#school_name#}', NULL, '🔒 Your One-Time Password (OTP) 🔒\r\n\r\nDear {#name#},\r\n\r\nYour One-Time Password (OTP) is: {#otp#}🔑\r\n\r\nIf you have concerns, contact us immediately.\r\n\r\nBest, {#school_name#}', 1, 1, 1, 0, '2024-03-12 10:57:27.000000', '2024-03-12 11:42:57.000000', NULL),
(42, 1, 1, 3, 7, 'Happy Birthday', '<p><p>Happy Birthday, {#name#}! </p><p>Wishing you, {#name#}, a \r\nday filled with laughter, love, and all the happiness in the world! May \r\nyour special day be as amazing as you are.</p><p>Cheers to another year of adventures, memories, and dreams coming true! </p><p>Sending you, {#name#}, lots of hugs and best wishes on your birthday!</p><p>Have a fantastic day and a fabulous year ahead, {#name#}!</p><p><br /></p><br /></p>', '🎉🎂 Happy Birthday, {#name#}! 🎂🎉\r\n\r\nWishing you, {#name#}, a day filled with laughter, love, and all the happiness in the world! May your special day be as amazing as you are. 🌟✨\r\n\r\nCheers to another year of adventures, memories, and dreams coming true! 🥳🎈\r\n\r\nSending you, {#name#}, lots of hugs and best wishes on your birthday! 🤗💖\r\n\r\nHave a fantastic day and a fabulous year ahead, {#name#}! 🎉🎁', NULL, '🎉🎂 Happy Birthday, {#name#}! 🎂🎉\r\n\r\nWishing you, {#name#}, a day filled with laughter, love, and all the happiness in the world! May your special day be as amazing as you are. 🌟✨\r\n\r\nCheers to another year of adventures, memories, and dreams coming true! 🥳🎈\r\n\r\nSending you, {#name#}, lots of hugs and best wishes on your birthday! 🤗💖\r\n\r\nHave a fantastic day and a fabulous year ahead, {#name#}! 🎉🎁', 1, 1, 1, 0, '2024-03-14 11:58:29.000000', '2024-03-14 11:58:48.000000', NULL),
(43, 1, 1, 3, 39, 'Renew', '<p>Dear {#name#},<br /><br />Your library seat has been Renew Successfully.<br /><br />&nbsp;Library name : {#library_name#}<br />&nbsp;Library Time Slot (Cabin No.) : {#cabin_name#}<br />&nbsp;Library Fees : {#library_fees#}<br />&nbsp;Locker : {#locker#}<br />&nbsp;Locker Amount  : {#locker_amount#}<br /><br /><br />&nbsp;{#school_name#}<br /></p>', 'Dear {#name#},\r\n\r\nYour library seat has been Renew Successfully.\r\n\r\nLibrary name : {#library_name#}\r\n\r\nLibrary Time Slot (Cabin No.) : {#cabin_name#}\r\n\r\nLibrary Fees : {#library_fees#}\r\n\r\nLocker : {#locker#}\r\n\r\nLocker Amount  : {#locker_amount#}\r\n\r\nJoin free test log in website \r\nwww.theperfectlearning.com\r\n\r\nHappy reading .\r\n\r\n{#school_name#}', NULL, 'Dear {#name#},\r\n\r\nYour library seat has been Renew Successfully.\r\n\r\nLibrary name : {#library_name#}\r\n\r\nLibrary Time Slot (Cabin No.) : {#cabin_name#}\r\n\r\nLibrary Fees : {#library_fees#}\r\n\r\nLocker : {#locker#}\r\n\r\nLocker Amount  : {#locker_amount#}\r\n\r\nJoin free test log in website \r\nwww.theperfectlearning.com\r\n\r\nHappy reading .\r\n\r\n{#school_name#}', 1, 1, 1, 0, '2024-03-15 10:21:30.000000', '2024-03-15 10:21:30.000000', NULL);
